function downloadTransactionDetails() {
    var labourId = 4;
    $.ajax({
        type: "GET",
        url: 'TransactionDetails/getIndividualLabourTransactionDetails',
        data: {
            labourId: labourId
        },
        cache: false,
        dataType: "json",
        success: function (data) {
            var body = [];
            var bodyheader = ['Sl No', 'Details', 'Amount (\u20B9)', 'Time'];
            body.push(bodyheader);
            $.each(data, function (index, value) {
                var bodycontent = [];
                bodycontent.push(index + 1);
                bodycontent.push(value.transactionDetails);
                bodycontent.push(value.transactionAmount);
                bodycontent.push(value.transactionTime);
                body.push(bodycontent);
            });
            var docDefinition = {
                pageMargins: [10, 10, 10, 10],
//                background: {
//                    image: 'data:image/png;base64,',
//                    alignment: 'center',
//                    fit: [500, 500],
//                    margin: [0, 10, 0, 0],
//                },
                content: [
                    {text: 'Name : Srijan Som', style: 'header', alignment: 'left'},
                    {text: 'Balance : \u20B9 500', style: 'header', alignment: 'left'},
                    {text: ' ', style: 'header', alignment: 'center'},
                    {text: ' ', style: 'header', alignment: 'center'},
                    {
                        pageSize: 'A4',
                        style: 'tableExample',
                        table: {
                            body,
                        },
                        layout: {
                            fillColor: function (i, node) {
                                return (i % 2 === 0) ? '#e6e6e6' : null;
                            }
                        },
                        fontSize: 10
                    },
                ],
            };
            pdfMake.createPdf(docDefinition).download('Transaction History');
        },
        error: function (data) {
            console.log("Error Happen");
        }
    });
}
downloadTransactionDetails();
function getIndividualLabourTransactionDetails() {
    var labourId = 4;
    $.ajax({
        type: "GET",
        url: 'TransactionDetails/getIndividualLabourTransactionDetails',
        data: {
            labourId: labourId
        },
        cache: false,
        dataType: "json",
        success: function (data) {
            console.log(data);
            var event_data = '';
            $.each(data, function (index, value) {
                event_data += '<tr>';
                event_data += '<td>' + value.transactionDetails + '</td>';
                event_data += '<td>' + value.transactionAmount + '</td>';
                event_data += '<td>' + value.transactionTime + '</td>';
                event_data += '</tr>';
            });
            $('#transactionTableId').append(event_data);
        },
        error: function (data) {
            console.log("Error Happen");
        }
    });
}
getIndividualLabourTransactionDetails();



